import React from 'react';
import './index.css';

function FlightCard(props) {
    return (
        <div className="flightCard">
            <div className="date">
                <h2>{props.flight}</h2>
                <p>9:00 - 12:00</p>
            </div>
            <hr/>
            <div className="ac">
                <div className="acTitle">
                    <h5>AC</h5>
                </div>
                <div className="acText">
                    <h5>Amelia Earheart</h5>
                </div>
            </div>
            <div className="fo">
                <div className="foTitle">
                    <h5>FO</h5>
                </div>
                <div className="foText">
                    <h5>Charles Hindbergh</h5>
                    <h5>D.B. Cooper</h5>
                </div>
            </div>
        </div>
    );
}

class Dashboard extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            flights: ["Thurs, May 2", "Fri, May 4"],
        };
    }

    renderUpcomingFlights() {
        var cards = []
        this.state.flights.forEach(flight => {
            cards.push(<FlightCard flight={flight}/>)
        });
        cards.push(<img src="./img/plane.png"/>);
        return cards
    }
    render() { 
        return (
            <div>
                <h2>Upcoming Flights</h2>
                <div className="upcomingFlights">
                    {this.renderUpcomingFlights()}
                </div>
            </div>

        )
    };
}

export default Dashboard;
